/*
===============================================================================
FILE: insert_mixed_orders_with_items.sql

PURPOSE:
This script inserts a controlled batch of orders and corresponding order_items
to simulate real-world transactional behavior in a retail system.

SCENARIO MODELED:
- Mix of Online (order_type_id = 1) and Store Pickup (order_type_id = 2)
- Orders and order_items inserted together
- Lower unit prices for non-famous artists
- Foreign key checks temporarily disabled to allow realistic partial failures
  during bulk inserts, simulating real-world data load scenarios.

IMPORTANT DATA ENGINEERING NOTE:
--------------------------------
This script intentionally demonstrates a real-world phenomenon where
AUTO_INCREMENT primary keys (order_items_id) may have gaps.

Reasons include:
- Foreign key validation failures during insert
- Partial batch insert execution
- FK checks toggled during data load
- Rejected rows still consuming AUTO_INCREMENT values

As a result:
  COUNT(order_items) < MAX(order_items_id)

This is EXPECTED behavior in MySQL and reflects production-grade systems.
Primary keys guarantee uniqueness, NOT continuity.

This case is preserved intentionally for analytical and educational purposes.
------------------------------------------------------------------------------

EXECUTION ORDER
---------------
1. Disable foreign key checks
2. Insert into orders
3. Insert into order_items
4. Re-enable foreign key checks

===============================================================================
*/

-- Temporarily disable foreign key checks for controlled bulk inserts
SET FOREIGN_KEY_CHECKS = 0;

-- ------------------------------------------------------------
-- Insert mixed Online and Store Pickup orders
-- ------------------------------------------------------------


-- ------------------------------------------------------------
-- Insert order items linked to the above orders
-- ------------------------------------------------------------


--  Only if order_items_id is NOT referenced elsewhere

SET SQL_SAFE_UPDATES = 0;

-- Subtract 5000 from order_items_id for IDs 135001 and above because of previous erroneous addition
UPDATE order_items
SET order_items_id = order_items_id - 5000
WHERE order_items_id >= 135001;

SET SQL_SAFE_UPDATES = 1;

-- Restore referential integrity enforcement
SET FOREIGN_KEY_CHECKS = 1;

